export const append = (id, list)=>{
    console.log(id);
    console.log(list);
    for(var i = 0; i< list.length;i++)
    {
        if(list[id].IdMenu == id)
        {
            var menu = {};
            menu.IdMenu = list[i].IdMenu;
            menu.NameMenu = list[i].NameMenu;
            menu.Quantity = 1;
            menu.Price = list[i].Price;
            menu.TotalPrice = list[i].Price;
            return menu;
        }
    }
}
